import React from "react";
import { NavLink } from "react-router-dom";
import logo from "../utils/logo_menu.png";

export default function NavBar() {
  return (
    // <nav className="navbar navbar-expand-lg navbar-light bg-light">
    //   <div class="container">
    //     <a className="align-self-center" href="/">
    //       <img alt="logo" src={logo}></img>
    //     </a>
    //     <button
    //       className="navbar-toggler"
    //       type="button"
    //       data-toggle="collapse"
    //       data-target="#navbarSupportedContent"
    //       aria-controls="navbarSupportedContent"
    //       aria-expanded="false"
    //       aria-label="Toggle navigation"
    //     >
    //       <span className="navbar-toggler-icon"></span>
    //     </button>

    //     <div className="collapse navbar-collapse" id="navbarSupportedContent">
    //       <ul className="navbar-nav mr-auto">
    //         <li className="nav-item dropdown">
    //           <a
    //             className="nav-link dropdown-toggle"
    //             href="#"
    //             id="navbarDropdown"
    //             role="button"
    //             data-toggle="dropdown"
    //             aria-haspopup="true"
    //             aria-expanded="false"
    //           >
    //             Admin. Datos
    //           </a>
    //           <div className="dropdown-menu" aria-labelledby="navbarDropdown">
    //             <a className="dropdown-item" href="#">
    //               Alumnos
    //             </a>
    //             <div className="dropdown-divider"></div>
    //             <NavLink to="/home" className="dropdown-item">
    //               Docentes
    //             </NavLink>
    //             <div className="dropdown-divider"></div>
    //             <a className="dropdown-item" href="#">
    //               Materias
    //             </a>
    //           </div>
    //         </li>
    //         <li className="nav-item dropdown">
    //           <a
    //             className="nav-link dropdown-toggle"
    //             href="#"
    //             id="navbarDropdown"
    //             role="button"
    //             data-toggle="dropdown"
    //             aria-haspopup="true"
    //             aria-expanded="false"
    //           >
    //             Calificaciones
    //           </a>
    //           <div className="dropdown-menu" aria-labelledby="navbarDropdown">
    //             <a className="dropdown-item" href="#">
    //               Ingresar
    //             </a>
    //             <div className="dropdown-divider"></div>
    //             <a className="dropdown-item" href="#">
    //               Mesas de Examen
    //             </a>
    //             <div className="dropdown-divider"></div>
    //             <a className="dropdown-item" href="#">
    //               Boletines
    //             </a>
    //           </div>
    //         </li>
    //         <li className="nav-item dropdown">
    //           <a
    //             className="nav-link dropdown-toggle"
    //             href="#"
    //             id="navbarDropdown"
    //             role="button"
    //             data-toggle="dropdown"
    //             aria-haspopup="true"
    //             aria-expanded="false"
    //           >
    //             Inasistencias
    //           </a>
    //           <div className="dropdown-menu" aria-labelledby="navbarDropdown">
    //             <a className="dropdown-item" href="#">
    //               Ingresar
    //             </a>
    //             <div className="dropdown-divider"></div>
    //             <a className="dropdown-item" href="#">
    //               Reincorporaciones
    //             </a>
    //           </div>
    //         </li>
    //       </ul>
    //     </div>
    //   </div>
    // </nav>
    <div>
      {/* // <!--Main Navigation--> */}
      <header>
        {/* <!-- Sidebar --> */}
        <nav
          id="sidebarMenu"
          class="collapse d-lg-block sidebar collapse bg-white"
        >
          <div class="position-sticky">
            <div class="list-group list-group-flush mx-3 mt-4">
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
                aria-current="true"
              >
                <i class="fas fa-tachometer-alt fa-fw me-3"></i>
                <span>Main dashboard</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple active"
              >
                <i class="fas fa-chart-area fa-fw me-3"></i>
                <span>Webiste traffic</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-lock fa-fw me-3"></i>
                <span>Password</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-chart-line fa-fw me-3"></i>
                <span>Analytics</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-chart-pie fa-fw me-3"></i>
                <span>SEO</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-chart-bar fa-fw me-3"></i>
                <span>Orders</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-globe fa-fw me-3"></i>
                <span>International</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-building fa-fw me-3"></i>
                <span>Partners</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-calendar fa-fw me-3"></i>
                <span>Calendar</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-users fa-fw me-3"></i>
                <span>Users</span>
              </a>
              <a
                href="/"
                class="list-group-item list-group-item-action py-2 ripple"
              >
                <i class="fas fa-money-bill fa-fw me-3"></i>
                <span>Sales</span>
              </a>
            </div>
          </div>
        </nav>
        {/* <!-- Sidebar -->

  <!-- Navbar --> */}
        <nav
          id="main-navbar"
          class="navbar navbar-expand-lg navbar-light bg-white fixed-top"
        >
          {/* <!-- Container wrapper --> */}
          <div class="container-fluid">
            {/* <!-- Toggle button --> */}
            <button
              class="navbar-toggler"
              type="button"
              data-mdb-toggle="collapse"
              data-mdb-target="#sidebarMenu"
              aria-controls="sidebarMenu"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <i class="fas fa-bars"></i>
            </button>

            {/* <!-- Brand --> */}
            <a class="navbar-brand" href="/">
              <img
                src="https://mdbcdn.b-cdn.net/img/logo/mdb-transaprent-noshadows.webp"
                height="25"
                alt="MDB Logo"
                loading="lazy"
              />
            </a>
            {/* <!-- Search form --> */}
            <form class="d-none d-md-flex input-group w-auto my-auto">
              <input
                autocomplete="off"
                type="search"
                class="form-control rounded"
                placeholder='Search (ctrl + "/" to focus)'
                style={{ minWidth: "225px" }}
              />
              <span class="input-group-text border-0">
                <i class="fas fa-search"></i>
              </span>
            </form>

            {/* <!-- Right links --> */}
            <ul class="navbar-nav ms-auto d-flex flex-row">
              {/* <!-- Notification dropdown --> */}
              <li class="nav-item dropdown">
                <a
                  class="nav-link me-3 me-lg-0 dropdown-toggle hidden-arrow"
                  href="/"
                  id="navbarDropdownMenuLink"
                  role="button"
                  data-mdb-toggle="dropdown"
                  aria-expanded="false"
                >
                  <i class="fas fa-bell"></i>
                  <span class="badge rounded-pill badge-notification bg-danger">
                    1
                  </span>
                </a>
                <ul
                  class="dropdown-menu dropdown-menu-end"
                  aria-labelledby="navbarDropdownMenuLink"
                >
                  <li>
                    <a class="dropdown-item" href="/">
                      Some news
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      Another news
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      Something else here
                    </a>
                  </li>
                </ul>
              </li>

              {/* <!-- Icon --> */}
              <li class="nav-item">
                <a class="nav-link me-3 me-lg-0" href="/">
                  <i class="fas fa-fill-drip"></i>
                </a>
              </li>
              {/* <!-- Icon --> */}
              <li class="nav-item me-3 me-lg-0">
                <a class="nav-link" href="/">
                  <i class="fab fa-github"></i>
                </a>
              </li>

              {/* <!-- Icon dropdown --> */}
              <li class="nav-item dropdown">
                <a
                  class="nav-link me-3 me-lg-0 dropdown-toggle hidden-arrow"
                  href="/"
                  id="navbarDropdown"
                  role="button"
                  data-mdb-toggle="dropdown"
                  aria-expanded="false"
                >
                  <i class="flag-united-kingdom flag m-0"></i>
                </a>
                <ul
                  class="dropdown-menu dropdown-menu-end"
                  aria-labelledby="navbarDropdown"
                >
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-united-kingdom flag"></i>English
                      <i class="fa fa-check text-success ms-2"></i>
                    </a>
                  </li>
                  <li>
                    <hr class="dropdown-divider" />
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-poland flag"></i>Polski
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-china flag"></i>
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-japan flag"></i>
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-germany flag"></i>Deutsch
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-france flag"></i>Franais
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-spain flag"></i>Espaol
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-russia flag"></i>
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      <i class="flag-portugal flag"></i>Portugus
                    </a>
                  </li>
                </ul>
              </li>

              {/* <!-- Avatar --> */}
              <li class="nav-item dropdown">
                <a
                  class="nav-link dropdown-toggle hidden-arrow d-flex align-items-center"
                  href="/"
                  id="navbarDropdownMenuLink"
                  role="button"
                  data-mdb-toggle="dropdown"
                  aria-expanded="false"
                >
                  <img
                    src="https://mdbcdn.b-cdn.net/img/Photos/Avatars/img (31).webp"
                    class="rounded-circle"
                    height="22"
                    alt="Avatar"
                    loading="lazy"
                  />
                </a>
                <ul
                  class="dropdown-menu dropdown-menu-end"
                  aria-labelledby="navbarDropdownMenuLink"
                >
                  <li>
                    <a class="dropdown-item" href="/">
                      My profile
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      Settings
                    </a>
                  </li>
                  <li>
                    <a class="dropdown-item" href="/">
                      Logout
                    </a>
                  </li>
                </ul>
              </li>
            </ul>
          </div>
          {/* <!-- Container wrapper --> */}
        </nav>
        {/* <!-- Navbar --> */}
      </header>
      {/* <!--Main Navigation--> */}

      {/* <!--Main layout--> */}
      <main style="margin-top: 58px;">
        <div class="container pt-4"></div>
      </main>
      {/* <!--Main layout--> */}
    </div>
  );
}
